import React from 'react';

class BinaryNode {
    constructor(props) {
        this.value = props ? props.value : null;
        this.left  = null;
        this.right = null;
    }

    addRightChild(value) {
        this.right = <BinaryNode>3</BinaryNode>
    }
}

export default class BinaryTree {
    constructor() {
        this.root = null;
    }
}
